//import { Link } from 'react-router-dom';

const Footer: React.StatelessComponent = () => {
  return (
    <footer>
        <ul className="footerLinks">
            <li>
                About
            </li>
            <li>
                Contact
            </li>
            <li>
                Privacy
            </li>
        </ul>


    </footer>
  );
};

export default Footer;
